ALTER TABLE PRCompanyClassification DISABLE TRIGGER ALL
INSERT INTO PRCompanyClassification (prc2_CompanyClassificationId, prc2_CompanyId, prc2_ClassificationId, prc2_CreatedBy, prc2_CreatedDate, prc2_UpdatedBy, prc2_UpdatedDate, prc2_TimeStamp) 
SELECT (@ID + row_number() over (order by prc2_CompanyID )) AS ID,
       prc2_CompanyID, 2190,
	   1, GETDATE(), 1, GETDATE(), GETDATE()
  FROM (
		SELECT DISTINCT prc2_CompanyID
		  FROM PRCompanyClassification
		 WHERE prc2_ClassificationID IN (2191, 2192)
		   AND prc2_CompanyID NOT IN (SELECT prc2_CompanyID FROM PRCompanyClassification WHERE prc2_ClassificationID = 2190)
		) T1


UPDATE PRCompanyClassification
   SET prc2_NumberOfStores = NumberOfStores
  FROM (
		SELECT prc2_CompanyID, MAX(prc2_NumberOfStores) as NumberOfStores
		  FROM PRCompanyClassification
		 WHERE prc2_ClassificationID IN (2190, 2191, 2192)
		   AND prc2_NumberOfStores IS NOT NULL
		GROUP BY prc2_CompanyID) T1
 WHERE PRCompanyClassification.prc2_CompanyID = T1.prc2_CompanyId
   AND PRCompanyClassification.prc2_ClassificationId = 2190

DELETE FROM PRCompanyClassification WHERE prc2_ClassificationID IN (2191, 2192) 
