SELECT @CountryID = MAX(prcn_CountryID) + 1 FROM PRCountry
SELECT @NewStateID = MAX(prst_StateID) + 1 FROM PRState
INSERT INTO PRCountry (prcn_CountryID, prcn_Country, prcn_Language, prcn_ContinentCode, prcn_CreatedBy, prcn_CreatedDate, prcn_UpdatedBy, prcn_UpdatedDate, prcn_Timestamp)
 VALUES (@CountryID, 'British Virgin Islands', 'E', 'NA', 3, GETDATE(), 3, GETDATE(), GETDATE());

INSERT INTO PRState (prst_StateID, prst_CountryID, prst_CreatedBy, prst_CreatedDate, prst_UpdatedBy, prst_UpdatedDate, prst_Timestamp)
			VALUES (@NewStateID, @CountryID, 3, GETDATE(), 3, GETDATE(), GETDATE());

DECLARE @NextId int
EXEC @NextId = eware_get_identity_id 'PRCity';
INSERT 
	INTO [CRM].[dbo].[PRCity]
        ([prci_CityID]
        ,[prci_CreatedBy],[prci_CreatedDate],[prci_UpdatedBy],[prci_UpdatedDate],[prci_TimeStamp]
        ,[prci_City],[prci_StateId],[prci_RatingTerritory],[prci_RatingUserId],[prci_SalesTerritory]
        ,[prci_InsideSalesRepId],[prci_FieldSalesRepId],[prci_ListingSpecialistId],[prci_CustomerServiceId]
        ,prci_LumberRatingUserId, prci_LumberInsideSalesRepId, prci_LumberFieldSalesRepId, prci_LumberListingSpecialistId
		,prci_LumberCustomerServiceId)
	SELECT @NextID
        ,3,  GETDATE(), 3,  GETDATE(),  GETDATE()
		,'Great Harbour', @NewStateID, [prci_RatingTerritory],[prci_RatingUserId],[prci_SalesTerritory]
        ,[prci_InsideSalesRepId],[prci_FieldSalesRepId],[prci_ListingSpecialistId],[prci_CustomerServiceId]
        ,prci_LumberRatingUserId, prci_LumberInsideSalesRepId, prci_LumberFieldSalesRepId, prci_LumberListingSpecialistId
		,prci_LumberCustomerServiceId
	FROM [CRM].[dbo].[PRCity]
    WHERE [prci_CityID] = 14757;
